from typing import List

class Solution:
    def findKthLargest(self, nums: List[int], k: int) -> int:
        # An implementation similar to counting sort
        arr = [0] * 20001
        for n in nums:
            arr[n+10000] += 1
        for i in range(20000, -1, -1):
            if arr[i] > 0:
                k -= arr[i]
            if k <= 0:
                return i - 10000


